import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import { AppProvider, useAuth } from './assets/Context/AppContext';

// App content component that uses contexts
const AppContent = () => {
  const { user, loading } = useAuth();

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gray-50">
        <div className="text-center">
          <div className="w-16 h-16 border-4 border-orange-500 border-t-transparent rounded-full animate-spin mx-auto mb-4"></div>
          <p className="text-gray-600">Loading...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50">
      <header className="bg-white shadow-sm">
        <div className="max-w-7xl mx-auto px-4 py-4">
          <h1 className="text-2xl font-bold text-gray-900">Food Delivery App</h1>
          {user && <p className="text-gray-600">Welcome, {user.name}!</p>}
        </div>
      </header>
      
      <main className="max-w-7xl mx-auto px-4 py-8">
        <div className="text-center">
          <h2 className="text-4xl font-bold text-gray-900 mb-4">
            Welcome to Food Delivery! üçï
          </h2>
          <p className="text-lg text-gray-600">
            Context system is working successfully!
          </p>
          <div className="mt-6 space-y-2">
            <p className="text-sm text-gray-500">Authentication Status: {user ? 'Logged In' : 'Not Logged In'}</p>
            <p className="text-sm text-gray-500">Loading State: {loading ? 'Loading' : 'Ready'}</p>
          </div>
        </div>
      </main>
    </div>
  );
};

const App = () => {
  return (
    <BrowserRouter>
      <AppProvider>
        <AppContent />
      </AppProvider>
    </BrowserRouter>
  );
};

export default App;
